  false,\n\t\"url\": null,\n\t\"notes\": \"Presented in this dataset are data determined
  from sediments collected by different means during a variety of cruises to the northwest
  Atlantic Ocean. These data have been collected in an attempt to gain knowledge of
  the interrelationships between early diagenesis and remineralization of organic
  matter, bioturbation, and dissolved ion exchange between sediments and the overlying
  water. All data are from surficial sediments (0-3 cm below the sediment-water interface).\",\n\t\"license_title\":
